"use strict";
// Tuple  == คล้ายๆกับ array แต่ ต้องระบุจำนวน type ชัดเจน และสามารถ มีชนิดข้อมูลของสมาชิกต่างกันได้
const aaaa3 = [10, 20, "ccc"];
// เปลี่ยนข้อมูล
aaaa3[0] = 30;
console.log(aaaa3[0]);
console.log(aaaa3);
// Tule Label == กำหนดชื่อ หรือ กำหนดความหมายให้ แต่ละ type ของข้อมูล
const days = [11, 22, "33"];
console.log(days);
const days2 = ["one", 22222, "three3"];
console.log(days2);
